    public function getSourceContext(): Source
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Product index{% endblock %}

{% block body %}
    <div class=\"container mt-4\">
        <h1 class=\"mb-4\">Product index</h1>

        <table class=\"table table-striped table-bordered\">
            <thead class=\"table-dark\">
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Description</th>
                    <th>Price</th>
                    <th>Quantity</th>
                    <th>Actions</th>
                    <th>Add to Cart</th>
                </tr>
            </thead>
            <tbody>
            {% for product in products %}
                <tr>
                    <td>{{ product.id }}</td>
                    <td>{{ product.Name }}</td>
                    <td>{{ product.Description }}</td>
                    <td>{{ product.Price }}</td>
                    <td>{{ product.Quantity }}</td>
                    <td>
                        <a href=\"{{ path('app_product_show', {'id': product.id}) }}\" class=\"btn btn-info btn-sm\">Show</a>
                        <a href=\"{{ path('app_product_edit', {'id': product.id}) }}\" class=\"btn btn-warning btn-sm\">Edit</a>
                    </td>
                    <td><a href=\"{{ path('app_cart_add', {'id': product.id}) }}\" class=\"btn btn-success\">Add to Cart</a></td>
                </tr>
            {% else %}
                <tr>
                    <td colspan=\"6\" class=\"text-center\">No records found</td>
                </tr>
            {% endfor %}
            </tbody>
        </table>

        <a href=\"{{ path('app_product_new') }}\" class=\"btn btn-success mt-3\">Create new</a>
    </div>
{% endblock %}
", "product/index.html.twig", "/home/viaansh/shop/templates/product/index.html.twig");
